To determine how many 6 cm radius spheres can be formed from a cylindrical wire with a radius of 8 cm and a height of 3 cm, we need to follow these steps:

1. **Calculate the volume of the cylindrical wire:**

   The formula for the volume \( V \) of a cylinder is:
   \[
   V = \pi r^2 h
   \]
   where \( r \) is the radius and \( h \) is the height.

   For the cylindrical wire:
   \[
   r = 8 \text{ cm}, \quad h = 3 \text{ cm}
   \]

   Substituting these values into the formula:
   \[
   V_{\text{cylinder}} = \pi (8)^2 (3) = \pi \cdot 64 \cdot 3 = 192\pi \text{ cubic centimeters}
   \]

2. **Calculate the volume of one sphere:**

   The formula for the volume \( V \) of a sphere is:
   \[
   V = \frac{4}{3} \pi r^3
   \]
   where \( r \) is the radius.

   For each sphere:
   \[
   r = 6 \text{ cm}
   \]

   Substituting these values into the formula:
   \[
   V_{\text{sphere}} = \frac{4}{3} \pi (6)^3 = \frac{4}{3} \pi \cdot 216 = 288\pi \text{ cubic centimeters}
   \]

3. **Determine how many spheres can be formed:**

   To find the number of spheres that can be formed from the cylindrical wire, we divide the volume of the cylinder by the volume of one sphere:
   \[
   \text{Number of spheres} = \frac{V_{\text{cylinder}}}{V_{\text{sphere}}} = \frac{192\pi}{288\pi}
   \]

   The \(\pi\) terms cancel out:
   \[
   \text{Number of spheres} = \frac{192}{288}
   \]

   Simplify the fraction:
   \[
   \frac{192}{288} = \frac{2}{3}
   \]

