original_question:
త్రిభుజం $ABC$ సమద్విబుజం, $AB=AC$ మరియు ఎత్తు $AM=11.$ $\overline{AM}$ పై $D$ అనే బిందువు ఉంది, $AD=10$ మరియు $\angle BDC=3\angle BAC.$  అయితే, త్రిభుజం $ABC$ యొక్క పరిధిని కనుగొనండి.

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
[/asy]

