ఒక చతురస్రాకార మైదానం క్రీడా ట్రాక్‌లో చుట్టబడింది, క్రింద చూపినట్లుగా. ట్రాక్ మైదానంలోని రెండు అంచులు మరియు రెండు అర్ధవృత్తాలతో కూడి ఉంటుంది. ట్రాక్ పొడవు 400 మీటర్లు. మైదానం యొక్క గరిష్టమైన విస్తీర్ణం ఎంత, చదరపు మీటర్లలో?

[asy]
unitsize(1 cm);

filldraw((0,0)--(3,0)--(3,2)--(0,2)--cycle,lightgreen);
draw((0,0)--(3,0),linewidth(2*bp));
draw((0,2)--(3,2),linewidth(2*bp));
draw(arc((3,1),1,-90,90),linewidth(2*bp));
draw(arc((0,1),1,90,270),linewidth(2*bp));
[/asy]

