Let's define the cost of one pencil as \( p \) dollars and the cost of one eraser as \( e \) dollars. We are given two equations based on the information provided:

1. The cost of two pencils and one eraser is $1.24:
\[ 2p + e = 1.24 \]

2. The cost of five pencils and one eraser is $1.82:
\[ 5p + e = 1.82 \]

To find the cost of one pencil, we can eliminate the cost of the eraser by subtracting the first equation from the second equation:
\[ (5p + e) - (2p + e) = 1.82 - 1.24 \]
\[ 5p + e - 2p - e = 0.58 \]
\[ 3p = 0.58 \]
\[ p = \frac{0.58}{3} \]
\[ p = 0.1933 \]

To find the cost of one pencil in cents, we convert $0.1933 to cents by multiplying by 100:
\[ p = 0.1933 \times 100 \]
